import { createSlice, createAsyncThunk } from "@reduxjs/toolkit"
import {authService} from './authService'

const user = JSON.parse(localStorage.getItem('user'))

const initialState = {
  user: user ? user : null,
  isError: false,
  isSuccess: false,
  isLoading: false,
  message: '',
}

export const authSlice = () => {
  return (
    <div>authSlice</div>
  )
}

export default authSlice.reducer
